function pageReady(){$(".ms2").select2();$("#cgTime").val(getDate()).datepicker("update");getGroup();$("#groupSelect").on("select2:select",()=>getProcessor())}function setOptions(n,t){const r='<option value="{0}">{1}<\/option>';let i="";for(let u=0,f=n.length;u<f;u++){const f=n[u];i+=r.format(f.Id,f[t])}return i}function getGroup(){const n={};n.opType=1077;n.opData=JSON.stringify({menu:!0});ajaxPost("/Relay/Post",n,n=>{if(n.errno!=0){layer.msg(n.errmsg);return}$("#groupSelect").empty().append(setOptions(n.datas,"Group"));getProcessor()})}function getProcessor(){const t=$("#groupSelect").val(),n={};n.opType=1081;n.opData=JSON.stringify({groupId:t,menu:!0});ajaxPost("/Relay/Post",n,n=>{if(n.errno!=0){layer.msg(n.errmsg);return}$("#qgProcessor").empty().append(setOptions(n.datas,"Processor"))})}